import axios from "axios";
import React, { useState, useEffect } from "react";
import "./App.css";
import availData from "./components/test_data";
import queryData from "./components/data_test";

function App() {
	// const [cpLocation, setCPLocation] = useState("");
	// const [cpAvailability, setCPAvailability] = useState("");

	// const urlLocation = `https://api.data.gov.sg/v1/transport/carpark-availability`;
	// const urlAvailability = `https://api.data.gov.sg/v1/transport/carpark-availability`;

	// useEffect(() => {
	// 	axios.get(url).then((res) => {
	// 		console.log(availData.items[0].carpark_data);
	// 	});
	// }, [cpLocation]);

	// console.log(queryData.result.records);

	const qData = queryData.result.records;
	let qResult = qData.map((element) => {
		return {
			address: element.address,
			nonSeasonLot: element.short_term_parking,
			freeParking: element.free_parking,
			cParkId: element.car_park_no,
		};
	});

	console.log("before", qResult);

	let cPDataArr = availData.items[0].carpark_data;
	const newData = [];
	for (const item of qResult) {
		for (const element of cPDataArr) {
			if (item.cParkId === element.carpark_number) {
				// console.log(qResult.indexOf(item));
				newData.push({
					address: item.address,
					availableLots: element.carpark_info[0].lots_available,
					totalLots: element.carpark_info[0].total_lots,
					nonSeasonLot: item.nonSeasonLot,
					freeParking: item.freeParking,
					cpId: item.cParkId,
				});
			}
		}
	}

	console.log("after", newData);

	const handleSubmit = (e) => {
		e.preventDefault();
		console.log("hurrah");
	};

	return (
		<div className="App">
			<header>
				<nav>
					<ul>
						<li>Home</li>
						<li>About</li>
						<li>Contact</li>
					</ul>
				</nav>
			</header>

			<main>
				<form onSubmit={handleSubmit}>
					<input type="text" />
					<input type="submit" />
				</form>
				<article>
					<div>Traffic Cam</div>
					<div>ERP rates</div>
				</article>
			</main>
			<footer></footer>
		</div>
	);
}

export default App;
